import { FunctionComponent, useCallback } from "react";
import { useNavigate } from "react-router-dom";
import styles from "./Entrevistas.module.css";
const Entrevistas: FunctionComponent = () => {
  const navigate = useNavigate();

  const onImage22Click = useCallback(() => {
    window.open(
      "https://www.uol.com.br/esporte/futebol/ultimas-noticias/2012/03/30/maior-acervo-sobre-futebol-do-brasil-esta-escondido-no-alto-da-serra-da-cantareira.htm"
    );
  }, []);

  const onImage25Click = useCallback(() => {
    window.open(
      "https://www.rankbrasil.com.br/Recordes/Materias/069x/Biblioteca_Com_Maior_Acervo_Sobre_Futebol"
    );
  }, []);

  const onJoseRenato1ImageClick = useCallback(() => {
    window.open(
      "https://ge.globo.com/ce/futebol/times/floresta/noticia/do-amador-ao-acesso-a-serie-c-floresta-se-transforma-e-reaviva-memorias-do-neto-do-fundador.ghtml"
    );
  }, []);

  const onImage29Click = useCallback(() => {
    window.open(
      "http://sportv.globo.com/site/programas/redacao-sportv/noticia/2011/10/distintivos-de-futebol-jose-renato-santiago-e-o-convidado-desta-terca.html"
    );
  }, []);

  const onImage27Click = useCallback(() => {
    window.open(
      "https://www1.folha.uol.com.br/saopaulo/2012/04/1078804-colecionador-de-livros-de-futebol-quer-que-acervo-vire-publico.shtml"
    );
  }, []);

  const onImage32Click = useCallback(() => {
    window.open(
      "https://terceirotempo.uol.com.br/noticias/jose-renato-satiro-santiago-jr-lanca-livro-nesta-terca-feira-em-sao-paulo"
    );
  }, []);

  const onImage23Click = useCallback(() => {
    window.open("http://caras.uol.com.br/noticia/herodoto-e-jose-renato");
